  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"changelog"}}>{`Changelog`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"105"}}>{`1.0.5`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`Fixed a bug with \`<LoadScript language />\` prop update and cleanup after unmount
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"106"}}>{`1.0.6`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`added \`onUnmount\` func prop to \`<LoadScript />\`
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"107"}}>{`1.0.7`}</MDXTag>
<MDXTag name="p" components={components}>{`fix memory leak of google-maps-api-v3`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"108"}}>{`1.0.8`}</MDXTag>
<MDXTag name="p" components={components}>{`added property `}<MDXTag name="inlineCode" components={components} parentName="p">{`options`}</MDXTag>{` to `}<MDXTag name="inlineCode" components={components} parentName="p">{`<GoogleMap options={}>`}</MDXTag></MDXTag>
<MDXTag name="p" components={components}>{`options are consistent with `}<MDXTag name="a" components={components} parentName="p" props={{"href":"https://developers.google.com/maps/documentation/javascript/reference/map#MapOptions"}}>{`MapOptions Interface`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
